import React, { Component } from 'react';
import { Text, Div, Image} from "atomize";



class GIF extends React.Component {

    render() { 

        return (
            <Div
                m={{ b: "40px" }}
            >
                <Image src="./gif/1.gif" />
            </Div>
            )
    }
}

export default GIF;
